    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Signin Template · Bootstrap v5.3{% endblock %}

{% block body %}
<main class=\"form-signin w-100 m-auto\">
    <form method=\"post\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        {% if app.user %}
            <div class=\"mb-3\">
                You are logged in as {{ app.user.userIdentifier }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
            </div>
        {% else %}
            <img class=\"mb-4\" src=\"https://www.techtrend-solutions.com/wp-content/uploads/2021/06/logo3-1.jpg\" alt=\"\" width=\"92\" height=\"67\">
            <h1 class=\"h3 mb-3 fw-normal\">Please sign in</h1>

            <div class=\"form-floating\">
                <input type=\"email\" class=\"form-control\" id=\"floatingInput\" name=\"_username\" placeholder=\"name@example.com\" required autofocus value=\"{{ last_username }}\">
                <label for=\"floatingInput\">Email address</label>
            </div>
            <div class=\"form-floating\">
                <input type=\"password\" class=\"form-control\" id=\"floatingPassword\" name=\"_password\" placeholder=\"Password\" required>
                <label for=\"floatingPassword\">Password</label>
            </div>

            <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">

            <div class=\"form-check text-start my-3\">
                <input class=\"form-check-input\" type=\"checkbox\" value=\"remember-me\" id=\"flexCheckDefault\" name=\"_remember_me\">
                <label class=\"form-check-label\" for=\"flexCheckDefault\">
                    Remember me
                </label>
            </div>
            <button class=\"btn btn-lg btn-primary w-100 py-2\" type=\"submit\">Sign in</button>
        {% endif %}
    </form>
</main>
{% endblock %}
", "security/login.html.twig", "/home/user/Desktop/interns_crud_TT/templates/security/login.html.twig");
